import React from "react";
import styled from "styled-components";
import { useHistory, useParams } from "react-router";


const Detail = (props) => {
    console.log(props);
    const history = useHistory();
    const day = useParams();

    return ( 
       <div>
        <Title>
          <span>
            {params.day}요일
          </span>{" "}
          평점 남기기
        </Title>          
        <GoWeek onClick={() => {
            history.push("/");
            }}>
                평점 남기기
            </GoWeek>
        </div>
    );
}

const Title = styled.h3`
    span { 
        color: white;
        background-color: orange;
        padding: 0.5rem;
        border-radius: 5px;
    }
    text-align: center;
`

const GoWeek = styled.button`
    width: 100%;
    background-color: purple;
    border: none;
    border-radius: 5px;
    padding: 1rem;
    color: white;
`


export default Detail;
